import Header from "./Header";
import Button from "@material-ui/core/Button";
import AddIcon from "@material-ui/icons/Add";

const EditNotes = () => {
  const [note, setNote] = useState({
    title: "",
    content: "",
  });
  return (
    <>
      <Header />
      <div className="main_note">
        <form>
          <input
            type="text"
            name="title"
            value={note.title}
            onChange={inputEvent}
            placeholder="Title"
            autoComplete="off"
          />
          )
          <textarea
            type="text"
            placeholder="Write  a note..."
            name="content"
            value={note.content}
            onChange={inputEvent}
            // onClick={setExpand}

            // rows=""
            // column=""
          ></textarea>
          (
          <Button>
            <AddIcon className="plus_sign" />
          </Button>
        </form>
      </div>
    </>
  );
};

export default EditNotes;
